import { Icon } from "@iconify/react";
import wildfire from "@iconify/icons-mdi/fire-alert";

const LocationMarker = ({ isVolcano, isWildfire, lat, lng, onClick }) => {
    let volmarker;
    let wildmarker;


  if (isVolcano) {
    volmarker = <Icon icon="emojione:volcano" className="location-icon" />;
  } 
  if (isWildfire) {
    marker = <Icon icon={wildfire} className="location-icon" />;
  }

  return (
    <div className="location-marker" onClick={onClick}>
      {marker}
    </div>
  );
};

export default LocationMarker;
